import React, {Fragment} from 'react'
import {
    ThemeProvider, 
    theme, 
    ColorModeProvider, 
    CSSReset,
} from '@chakra-ui/react'
import Timeline from './Timeline'


function App() {
  return (
    <ThemeProvider theme={theme}>
      <ColorModeProvider options={{
        useSystsemColorMode: true
      }}>
        <CSSReset/>
      </ColorModeProvider>
    </ThemeProvider>
  );
}

export default App;
